import React from 'react';
import FlatbenchRow from "./workouts/FlatbenchRow";
import ShoulderSquatPress from "./workouts/ShoulderSquatPress";

function WorkoutOptions() {
    return (
        <div className="container-fluid">
            <FlatbenchRow />
            <ShoulderSquatPress />
        </div>
        
    )
}

export default WorkoutOptions;
